class Garden {
    constructor(spaceAvailable) {
        this.spaceAvailable = spaceAvailable;
        this.plants = [];
        this.storage = [];

    }

    addPlant(plantName, spaceRequired) {
        if (this.spaceAvailable - spaceRequired < 0) {

            throw new Error('Not enough space in the garden.');

        } else {

            this.spaceAvailable -= spaceRequired;

            let plant = {
                plantName: plantName,
                spaceRequired: spaceRequired,
                ripe: false,
                quantity: 0
            }
            this.plants.push(plant);
        }
        return this.addPlant;
    }
    ripenPlant(plantName, quantity) {

        for (const plant1 of this.plants) {
            plant1.quantity = quantity;
            if (plant1.plantName !== plantName) {
                throw new Error(`There is no ${plantName} in the garden.`);
            } else if (plant1.ripe === true) {
                throw new Error(`The ${plantName} is already ripe.`);
            } else if (plant1.quantity <= 0) {
                throw new Error(`The quantity cannot be zero or negative.`);
            } else {
                plant1.ripe = true;
                if (quantity > 0) {
                    console.log(`${quantity} ${plantName} has successfully ripened.`);
                    return `${quantity} ${plantName} has successfully ripened.`;
                } else {
                    console.log(`${quantity} ${plantName}s have successfully ripened.`);
                    return `${quantity} ${plantName}s have successfully ripened.`
                }
            }

        }


        return this.ripenPlant;

    }
}

