byte decToBcd(byte val){
  return ( (val/10*16) + (val%10) );
}
byte bcdToDec(byte val)  {
  return ( (val/16*10) + (val%16) );
}

void setDateTime(){
  byte segundo = 30;
  byte minuto = 7;
  byte hora = 14;
  byte diasemana = 3;
  byte dia = 06;
  byte mes = 06;
  byte ano = 23;
  Wire.beginTransmission(DS1307_ADDRESS);
  Wire.write(zero); 
  Wire.write(decToBcd(segundo));
  Wire.write(decToBcd(minuto));
  Wire.write(decToBcd(hora));
  Wire.write(zero); 
  Wire.endTransmission();
}
bool PMbr;
bool PMal;

int printahora(bool modo){
  Wire.beginTransmission(DS1307_ADDRESS);
  Wire.write(zero);
  Wire.endTransmission();
  Wire.requestFrom(DS1307_ADDRESS, 7);
  int segundo = bcdToDec(Wire.read());
  int minuto = bcdToDec(Wire.read());
  int hora = bcdToDec(Wire.read() & 0b111111);    //Formato 24 horas
   if (hora <= 12) {
      PMbr = false;
   }
   if (hora > 12) {
      PMbr = true;
   }
  int diasemana = bcdToDec(Wire.read());             //0-6 -> Domingo - Sábado
  int dia = bcdToDec(Wire.read());
  int mes = bcdToDec(Wire.read());
  int ano = bcdToDec(Wire.read());
  int horaa = hora+4;
   if (horaa <= 12) {
      PMal = false;
   }
   if (horaa > 12) {
      PMal = true;
   }
  int resto = 0;
  int converte=0;

  if(horaa>23){
    resto = horaa - 24;
    horaa = resto;}
 // Serial.print(segundo);
  //Serial.print(minuto);
  //Serial.print(hora);
//Exibe a data e hora. Ex.:   3/12/13 19:00:00
  if(modo==1 && PMbr==1){
    hora=hora-12;
  }
  if(modo==1 && PMal==1){
    horaa=horaa-12;
  }
  if(hora<10)
    horas="0"+String(hora);
  else
    horas=String(hora);
    if(horaa<10)
    horasa="0"+String(horaa);
  else
    horasa=String(horaa);
  if(minuto<10)
    minutos="0"+String(minuto);
  else
    minutos=String(minuto);
  if(segundo<10)
    segundos="0"+String(segundo);
  else
    segundos=String(segundo);

  lcd.setCursor(0,0);
  lcd.print(horas);
  lcd.print(":");
  lcd.print(minutos);
  lcd.print(":");
  lcd.println(segundos);
  lcd.setCursor(8,0);
  
  if(modo==1 && PMbr==1){
    lcd.print(" PM BRA ");
  }
  if(modo==1 && PMbr==0){
    lcd.print(" AM BRA ");
  }
  if(modo ==0){
      lcd.print(" BRA     ");
  }

  lcd.setCursor(0,1);
  lcd.print(horasa);
  lcd.print(":");
  lcd.print(minutos);
  lcd.print(":");
  lcd.print(segundos);
  lcd.setCursor(8,1);
  if(modo==1 && PMal==1){
    lcd.print(" PM BER ");
  }
  if(modo==1 && PMal==0){
    lcd.print(" AM BER ");
  }
  if(modo ==0){
      lcd.print(" BER     ");
  }
  return minuto;
}


